import ge from '../core/ge.js';
const atLeast = ge;
export default atLeast;

import le from '../core/le.js';
const atMost = le;
export default atMost;

import gele from '../core/gele.js';
const between = gele;
export default between;

import len from '../core/len.js';
const count = len;
export default count;

import eq from '../core/eq.js';

/**
 * Returns whether input iterable is empty.
 *
 * @param {Iterable} iterable
 * @return {boolean}
 */
const isEmpty = (iterable) => eq(0, iterable);
export default isEmpty;

/**
 * Eq.
 *
 * @param {number} n
 * @param {Iterable} iterable
 */
const eq = (n, iterable) => {
	if (n < 0 || !Number.isInteger(n)) return false;

	if (iterable.length !== undefined) return iterable.length === n;

	if (iterable.size !== undefined) return iterable.size === n;

	const it = iterable[Symbol.iterator]();

	for (; n > 0; --n) if (it.next().done) return false;

	return it.next().done;
};

export default eq;

import gt from './gt.js';

/**
 * Ge.
 *
 * @param {number} n
 * @param {Iterable} iterable
 */
const ge = (n, iterable) => gt(n - 1, iterable);
export default ge;

import le from './le.js';
import ge from './ge.js';

/**
 * Gele.
 *
 * @param {number} m
 * @param {number} n
 * @param {Iterable} iterable
 */
const gele = (m, n, iterable) => {
	if (n < m) return false;

	if (n < 0) return false;

	if (m <= 0) return le(n, iterable);

	if (n === Number.POSITIVE_INFINITY) return ge(m, iterable);

	if (iterable.length !== undefined)
		return m <= iterable.length && iterable.length <= n;

	if (iterable.size !== undefined)
		return m <= iterable.size && iterable.size <= n;

	const it = iterable[Symbol.iterator]();

	n -= m;

	for (; m > 0; --m) if (it.next().done) return false;
	for (; n > 0; --n) if (it.next().done) return true;

	return it.next().done;
};

export default gele;

import gele from './gele.js';

/**
 * Gelt.
 *
 * @param {number} m
 * @param {number} n
 * @param {Iterable} iterable
 */
const gelt = (m, n, iterable) => gele(m, n - 1, iterable);
export default gelt;

import le from './le.js';

/**
 * Gt.
 *
 * @param {number} n
 * @param {Iterable} iterable
 */
const gt = (n, iterable) => !le(n, iterable);
export default gt;

import gele from './gele.js';

/**
 * Gtle.
 *
 * @param {number} m
 * @param {number} n
 * @param {Iterable} iterable
 */
const gtle = (m, n, iterable) => gele(m + 1, n, iterable);
export default gtle;

import gele from './gele.js';

/**
 * Gtlt.
 *
 * @param {number} m
 * @param {number} n
 * @param {Iterable} iterable
 */
const gtlt = (m, n, iterable) => gele(m + 1, n - 1, iterable);
export default gtlt;

/**
 * Le.
 *
 * @param {number} n
 * @param {Iterable} iterable
 */
const le = (n, iterable) => {
	if (n < 0) return false;

	if (iterable.length !== undefined) return iterable.length <= n;

	if (iterable.size !== undefined) return iterable.size <= n;

	const it = iterable[Symbol.iterator]();

	for (; n > 0; --n) if (it.next().done) return true;

	return it.next().done;
};

export default le;

/**
 * Len.
 *
 * @param {Iterable} iterable
 */
const length = (iterable) => {
	if (iterable.length !== undefined) return iterable.length;

	if (iterable.size !== undefined) return iterable.size;

	const it = iterable[Symbol.iterator]();

	let n = 0;

	while (!it.next().done) ++n;

	return n;
};

export default length;

import le from './le.js';

/**
 * Lt.
 *
 * @param {number} n
 * @param {Iterable} iterable
 */
const lt = (n, iterable) => le(n - 1, iterable);
export default lt;

import eq from './eq.js';

/**
 * Ne.
 *
 * @param {number} n
 * @param {Iterable} iterable
 */
const ne = (n, iterable) => !eq(n, iterable);
export default ne;

export {default as atLeast} from './api/atLeast.js';
export {default as atMost} from './api/atMost.js';
export {default as between} from './api/between.js';
export {default as count} from './api/count.js';
export {default as isEmpty} from './api/isEmpty.js';
export {default as eq} from './core/eq.js';
